import React from "react";

class Users extends React.Component {
    users = [
        {
            id:0,
            firstName:"Anton",
            lastName:"Limonovich",
            age:40,
            bio:"Lorem Ipsum",
            isHappy:true
        },
        {
            id:1,
            firstName:"Ipsum",
            lastName:"Antonovich",
            age:32,
            bio:"Lorem Ipsumovich",
            isHappy:false
        }
    ];
    render() {
        return (
            <div className="usersList">
                {this.users.map((user) => (<div className="cardOfUsers" key={user.id}>
                    <h3>{user.firstName} {user.lastName}</h3>
                    <p>{user.bio}</p>
                </div>))}
            </div>
        )};
};

export default Users;
